import express = require("express");
import bodyParser = require("body-parser");
import axios from "axios";
import * as _ from "lodash";
const FormData = require("form-data");
const multer = require("multer");

async function app() {
  const port = process.env.PORT || 3000;
  const app = express();
  const upload = multer();

  app.use(bodyParser.json());
  app.use(
    bodyParser.urlencoded({
      extended: true,
    })
  );
  app.use((req, res, next) => {
    const url = `https://${req.hostname}${req.path}`;

    console.log(req.hostname, req.method, req.path, req.protocol, url);

    next();
  });
  app.get("/scripts/TB401/properties", (req, res) => {
    res.json({
      success: true,
      free: false,
      hash: "8f3106998b047dceff60a7a6ba9ab9c4dba3feb0",
      engversion: "24.3.1",
    });
  });
  app.get("//apps/TB401/logininterface", (req, res) => {
    res.json({
      icon: "",
      x: 10000,
      y: 10000,
      width: 10000,
      height: 10000,
      is_debug: false,
      script_id: 24322,
      login_interface_html: "",
      uses_html_interface: false,
      interface_start_type: 0,
      success: true,
      message: "",
    });
  });
  app.post("//scripts/TB401/last/data", upload.none(), async (req, res) => {
    const form = new FormData();

    _.forEach(req.body, (v, k) => {
      form.append(k, v);
    });

    const { data } = await axios.post(
      "http://51.38.126.82/scripts/TB401/last/data",
      form,
      {
        headers: {
          ...(req.headers as any),
          host: "bablosoft.com",
          "content-type": "multipart/form-data",
        },
      }
    );

    console.log("data", data);

    res.json(data);
  });

  app.listen(port, () => {
    console.log(`App listening at http://localhost:${port}`);
  });
}

app().catch(console.error);
